import React, { useState } from 'react'

const Cart = () => {
  const [cart, setCart] = useState({});

}
const fetchCart = () => {
  commerce.cart.retrieve().then((cart) => {
    setCart(cart);
  }).catch((error) => {
    console.log('There was an error fetching the cart', error);
  });
}
export default Cart;
